class Sidebar extends Component {
    componentDidUpdate(prevProps, prevState, snapshot) {
        if (this.props.userComponents) {
            console.log(this.props.userComponents)
            console.log(userTreeBuilder(this.props.userComponents))
        }
    }

    render() {
        return (
            <div className="sidebar">
                <div className="container">
                    <div className="sidebar__inner">
                        <div className="sidebar__dividing-line"/>
                        <p className="sidebar__title">LIBRARY</p>

                        <div className="sidebar__wrapper">
                            <DirBtn dirName={"Library"}/>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}


export default Sidebar
